import React from 'react'
import { graphql, useStaticQuery } from 'gatsby';
import { Container } from 'react-bootstrap';
import Image from "../../common/Image"

const MainImage = () => {
    return (
        <Image
            imgData={useStaticQuery(graphql`
        query {
            placeholderImage: file(relativePath: { eq: "homepage/section1/main.png" }) {
                childImageSharp {
                    fluid(maxWidth: 1920) {
                        ...GatsbyImageSharpFluid
                    }
                }
            }
        }`)}
            style={{ zIndex: 1, width: "100%" }}
        />
    )
}


interface Props { }
const section = (props: Props) => {
    const tempVar = ["", "", ""]
    return (
        <div className="" id="testDivID">
            <MainImage />
            {
                tempVar.map((element, index) => {
                    return (
                        <div id={"testDivID" + index} style={{ width: 100, height: 100, backgroundColor: "#00f", margin: 10 }} />
                    )
                })
            }
        </div>
    )
}

export default section;
